import React from 'react';
import { Routes, Route } from 'react-router-dom';
import LoginPage from './views/LoginPage';
import RegisterPage from './views/RegisterPage';
import ForgotPasswordPage from './views/password/ForgotPasswordPage'; // Nueva página para olvidar contraseña
import ResetPasswordPage from './views/password/ResetPasswordPage'; // Nueva página para restablecer contraseña
import HomePage from './views/HomePage';

function App() {
  return (
    <Routes>
      <Route path="/login" element={<LoginPage />} />
      <Route path="/register" element={<RegisterPage />} />
      <Route path="/forgot-password" element={<ForgotPasswordPage />} />
      <Route path="/reset-password/:token" element={<ResetPasswordPage />} />
      <Route path="/" element={<HomePage />} />
    </Routes>
  );
}

export default App;
